import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ProductList from './ProductList';
import OrderItemsList from './OrderItemsList';
import CustomersList from './CustomersList';

function App() {
  return (
    <Router>
      <div>
        <h1>Sklep Internetowy - Frontend</h1>
        <nav>
          <Link to="/" style={linkStyle}>Produkty</Link>
          <Link to="/order-items" style={linkStyle}>Zam√≥wienia</Link>
          <Link to="/customers" style={linkStyle}>Klienci</Link>
        </nav>
        <Routes>
          <Route path="/" element={<ProductList />} />
          <Route path="/order-items" element={<OrderItemsList />} />
          <Route path="/customers" element={<CustomersList />} />
        </Routes>
      </div>
    </Router>
  );
}

const linkStyle = {
  marginRight: '15px',
  textDecoration: 'none',
  fontWeight: 'bold',
  color: '#333'
};

export default App;
